import './ExpenseItem.css'

function ExpenseItem() {
  return (
    <div classame="expense-item">
      <div>May 17th 1993</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$100.00</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
